import React, { Component } from "react";
import "./affiliations.css";

export default class Clients extends Component {
    render() {
        return (
        <section id="affiliations" className="affiliations">
            <div className="container">
                <img src="assets/img/handshake-new.png" alt="affiliations handshake" style={{width: "100%"}}/>
                <h1 className="text-center">Affilations</h1>
                <div className="partners">
                <div>
                <img src="assets/img/clients/aucsf.png" alt="AUCSF logo" data-aos="fade-down"/>
                <h2>AUCSF</h2>
                <p>The Assembly of Unibadan Christian Students Fellowship is the umrella body for Christian Student Fellowships in the University of Ibadan.
                    <br/>SCM UI as a member is therefore actively involved in her activities</p>
                </div>


                </div>
            </div>
        </section>
        )
    }
}
